  (Sem)
  (Joe)
  b 13.09.1923
  b 01.05.1917 d 01.01.1979
  Joe, s/o Richard Sunderland and Norah Williams. Joan and Joe are second cousins. Their biographical
  notes and descendants are listed under Joe's entry in this Family Tree.
